import React from 'react';
import TopScorers from '../components/TopScorers';

class Home extends React.Component {
  state = {
    topScorers: [
      {
        playerId: 1,
        name: 'Joe Bloggs',
        goals: 0
      },
      {
        playerId: 2,
        name: 'Lionel Messi',
        goals: 5
      },
      {
        playerId: 3,
        name: 'Neil Dewing',
        goals: 19
      }
    ],
    results: [
      {
        matchId: 1,
        matchDate: '',
        homeMatch: true,
        opponent: 'Leamington Juniors',
        ourScore: 3,
        opponentScore: 1,
        scorers: [1, 2]
      }
    ]
  };

  render() {
    return (
      <>
        <h1>FootyScores</h1>
        <TopScorers topScorers={this.state.topScorers} />
        <h2>Previous Result</h2>
        <h2>Next Match</h2>
      </>
    );
  }
}

export default Home;
